const personajes = ['Goku', 'Vegeta', 'Trunks'];
const [, , p3] = personajes;
console.log(p3);

const retornaArreglo = () => ['ABC', 123];

const [letras, numeros] = retornaArreglo();

console.log(letras, numeros);

// Tarea

const usarEstado = valor => [valor, () => console.log('Hola mundo')];

